import React from 'react';
import { Routes, Route, useLocation } from 'react-router-dom';
import { Box, CssBaseline } from '@mui/material';
import AppBar from './components/AppBar';
import Sidebar from './components/SideMenu';
import TransferCertificate from './Forms/TransferCertificate';
import Paragraph1 from './Forms/BscNursingForms/BscNursing2Year';
import Paragraph2 from './Forms/BscNursingForms/BscNursing3Year';
import Paragraph3 from './Forms/BscNursingForms/BscNursing4Year';
import Paragraph4 from './Forms/Paragraph4';
import Paragraph5 from './Forms/Paragraph5';
import Paragraph6 from './Forms/NursingSemester1';
import Paragraph7 from './Forms/NursingSemester3';
import BPT3Semester from './Forms/BPT Forms/BPT3Semester';
import BPT4Semester from './Forms/BPT Forms/BPT4Semester';
import BPT5Semester from './Forms/BPT Forms/BPT5Semester';
import BPT6Semester from './Forms/BPT Forms/BPT6Semester';
import BPT7Semester from './Forms/BPT Forms/BPT7Semester';
import BPT8Semester from './Forms/BPT Forms/BPT8Semester';
import NursingSemester4 from './Forms/NursingSemester4';
import AnesthesiaFirstYear from './Forms/BscAnesthesiaForms/AnesthesiaFirstYear';
import MLTSecondYear from './Forms/BscAnesthesiaForms/MLTSecondYear';
const App = () => {
  const location = useLocation();

  return (
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar/>
      <Sidebar />

      <Box
        component="main"
        sx={{
          flexGrow: 1,
          padding: 3,
          height: '100vh',
          overflowY: 'auto',
        }}
      >
        <Routes location={location}>
          <Route path="/" element={<TransferCertificate />} />
          <Route path="/para1" element={<Paragraph1/>} />
          <Route path="/para2" element={<Paragraph2/>} />
          <Route path="/para3" element={<Paragraph3/>} />
          <Route path="/para4" element={<Paragraph4/>} />
          <Route path="/para5" element={<Paragraph5/>} />
          <Route path="/para6" element={<Paragraph6/>} />
          <Route path="/para7" element={<Paragraph7/>} />
          <Route path="/para8" element={<BPT3Semester/>} />
          <Route path="/para9" element={<BPT4Semester/>} />
          <Route path="/para10" element={<BPT5Semester/>} />
          <Route path="/para11" element={<BPT6Semester/>} />
          <Route path="/para12" element={<BPT7Semester/>} />
          <Route path="/para13" element={<BPT8Semester/>} />
          <Route path="/para14" element={<NursingSemester4/>} />
          <Route path="/para15" element={<AnesthesiaFirstYear/>} />

          <Route path="/para16" element={<MLTSecondYear/>} />
        </Routes>
      </Box>
    </Box>
  );
};

export default App;
